import React from 'react';
import './doorGame.css';

//Imports Pictures for rendering later
import closedDoor from './closed_door.svg';
import robotDoor from './robot_door.svg';
import beachDoor from './beach_door.svg';
import spaceDoor from './space_door.svg';

const doorImage = {
    closed: closedDoor,
    robot: robotDoor,
    beach: beachDoor,
    space: spaceDoor
};

class doorGame extends React.Component{

    render(){
        return (
            <div className="door-row">
                <img id="door1" className="door-frame" src={doorImage.closed}/>
                <img id="door2" className="door-frame" src={doorImage.closed}/>
                <img id="door3" className="door-frame" src={doorImage.closed}/>
          </div>
        );
    }
};

export default doorGame;
